db.supplies.aggregate([
    {$match:{SUPPLY_NAME: "Blood glucose testing strips (physical object)"} },
    {$unwind: "$RATINGS" },
    {$group: {_id: null, quality: {$avg: "$RATINGS.QUALITY"} } },
    {$project: {_id: 0, quality: 1} }
])

db.PATIENTS.aggregate([
  { 
    $match: {
      PAYER: "Blue Cross Blue Shield"
    }
  },
  { 
    $unwind: "$SURVEYS" 
  },
  { 
    $match: {
      "SURVEYS.QUALITY_OF_LIFE": { $exists: true, $ne: null }
    }
  },
  { 
    $group: { 
      _id: null,
      avg_quality_of_life: { $avg: "$SURVEYS.QUALITY_OF_LIFE" }
    }
  },
  { 
    $project: { _id: 0, avg_quality_of_life: 1 } 
  }
])

db.transactions.aggregate([
  {
    $match: {
      PAYER_ID: "d31fccc3-1767-390d-966a-22a5156f4219"
    }
  },
  {
    $unwind: "$IMMUNIZATIONS"
  },
  {
   $match: {
      "IMMUNIZATIONS.IS_COVERED": false
    }
  },
  {
    $group: {
      _id: null,
      count: { $sum: 1 }
    }
  },
  {
    $project: {
      _id: 0,
      count: 1
    }
  }
])

db.immunizations.aggregate([
  {
    $lookup: {
      from: "payers",
      localField: "PAYER_ID",
      foreignField: "PAYER_ID",
      as: "payer"
    }
  },
  {
    $unwind: "$payer"
  },
  {
    $match: {
      "payer.NAME": "NO_INSURANCE"
    }
  },
  {
    $group: {
      _id: null,
      count: { $sum: 1 }
    }
  },
  {
    $project: {
      _id: 0,
      count: 1
    }
  }
])

db.imaging_studies.aggregate([
    { 
        $match: {
            _id: "ee88b224-1f91-8c6a-493a-46e8004c4331"
        } 
    },
    {
        $project: {
            _id: 0,
            body_site: "$BODY_SITE.CODE",
            description: "$BODY_SITE.DESCRIPTION",
            study_uid: "$STUDY_INSTANCE_UID",
            study_date: "$STUDY_DATE",
            study_time: "$STUDY_TIME"
        }
    }
])

db.patients.aggregate([
  {
    $match: {
      "CONDITIONS.DESCRIPTION": "Received higher education (finding)"
    }
  },
  {
    $project: {
      _id: 0,
      stopDate: {
        $dateToString: {
          format: "%Y-%m-%dT%H:%M:%S.%LZ",
          date: "$CONDITIONS.STOP_DATE"
        }
      }
    }
  }
])

db.patients.aggregate([
    {
        $match: {
            "OBSERVATIONS.CODE": "Body mass index (BMI) [Percentile] Per age and sex"
        }
    },
    {
        $unwind: "$OBSERVATIONS"
    },
    {
        $match: {
            "OBSERVATIONS.CODE": "Body mass index (BMI) [Percentile] Per age and sex"
        }
    },
    {
        $group: {
            _id: "$PATIENT_ID",
            BMI: { $first: "$OBSERVATIONS.VALUE" }
        }
    },
    {
        $project: {
            _id: 0,
            PATIENT_ID: "$_id",
            BMI: 1
        }
    }
])

db.claims.aggregate([
    {
        $match: {
            "OBSERVATIONS.CODE": "29463-7"
        }
    },
    {
        $unwind: "$OBSERVATIONS"
    },
    {
        $match: {
            "OBSERVATIONS.CODE": "29463-7"
        }
    },
    {
        $group: {
            _id: "$_id",
            RECEIVED_DATE: { $first: { $dateFromString: { format: "%Y-%m-%dT%H:%M:%SZ", dateString: "$OBSERVATIONS.RECEIVED_DATE"}}},
            RECEIVED_TIME: { $first: { $dateFromString: { format: "%Y-%m-%dT%H:%M:%SZ", dateString: "$OBSERVATIONS.RECEIVED_TIME"}}}
        }
    },
    {
        $project: {
            _id: 0,
            RECEIVED_DATE: "$RECEIVED_DATE",
            RECEIVED_TIME: "$RECEIVED_TIME"
        }
    }
])

db.patients.aggregate([
  { 
    $match: {
      PATIENT_ID: {
        $in: db.careplans.aggregate([
          {
            $match: {
              "CODE": {
                $eq: "443402002"
              }
            }
          },
          {
            $project: {
              _id: 0,
              PATIENT_ID: "$PATIENT_ID"
            }
          }
        ]).toArray()
      }
    }
  },
  {
    $project: {
      _id: 0,
      PATIENT_ID: "$PATIENT_ID",
      FIRST_NAME: "$NAME.FIRST_NAME",
      LAST_NAME: "$NAME.LAST_NAME"
    }
  }
])

db.procedures.aggregate([
  {
    $match: {
      PAYER_ID: "d31fccc3-1767-390d-966a-22a5156f4219",
      COVERED: true
    }
  },
  {
    $group: {
      _id: null,
      count: { $sum: 1 }
    }
  },
  {
    $project: {
      _id: 0,
      count: 1
    }
  }
])

db.claims.aggregate([
    {
      $match: {
        CLAIM_ID: "9b243e0d-551a-65e5-0e1f-c52f3c4a3d72"
      }
    },
    {
      $lookup: {
        from: "transactions",
        localField: "TRANSACTION_ID",
        foreignField: "TRANSACTION_ID",
        as: "transaction"
      }
    },
    {
      $unwind: "$transaction"
    },
    {
      $lookup: {
        from: "providers",
        localField: "transaction.PROVIDER_ID",
        foreignField: "PROVIDER_ID",
        as: "provider"
      }
    },
    {
      $unwind: "$provider"
    },
    {
      $project: {
        _id: 0,
        PROVIDER_ID: "$provider.PROVIDER_ID",
        PROVIDER_NAME: "$provider.PROVIDER_NAME"
      }
    }
  ])

db.patients.aggregate([
{ $unwind: "$CAREPLANS" },
{ $match: {"CAREPLANS.DESCRIPTION": "Infectious disease care plan (record artifact)"} },
{ $group: { _id: "$PERSON_ID" } },
{ $project: { _id: 0, PERSON_ID: "$_id" } }
])

