db.patients.aggregate([
    {
        $match: {
            "ENCOUNTERS.IMMUNIZATIONS.DESCRIPTION": {
                $in: ["Hep B (adolescent/pediatrics)", "Hepatitis B (adolescent/pediatric)"]
            }
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.IMMUNIZATIONS"
    },
    {
        $match: {
            "ENCOUNTERS.IMMUNIZATIONS.DESCRIPTION": {
                $in: ["Hep B (adolescent/pediatrics)", "Hepatitis B (adolescent/pediatric)"]
            }
        }
    },
    {
        $project: {
            _id: 0,
            ENCOUNTER_ID: "$ENCOUNTERS._id",
