        }
    }
])

db.patients.aggregate([
  { $unwind: "$ENCOUNTERS" },
  { $unwind: "$ENCOUNTERS.DEVICES" },
  {
    $match: {
      "ENCOUNTERS.DEVICES.CODE": "337414009"
    }
  },
  {
    $group: {
      _id: "$ENCOUNTERS.ENCOUNTER_ID",
      code: { $first: "$ENCOUNTERS.DEVICES.CODE" },
      type:  { $first: "$ENCOUNTERS.DEVICES.TYPE" },
      patientId: { $first: "$PATIENT_ID" }
    }
  },
  {
    $project: {
      _id: 0,
      encounterId: "$_id",
      code: 1,
      type: 1,
      patientId: 1
    }
  }
])

db.medicines.aggregate([
    {
      $unwind: "$SUCCESSRATES"
    },
    {
      $match: {
        "SUCCESSRATES.NDA": "NDA020800 0.3 ML",
        "SUCCESSRATES.MEDICATION_NAME": "Epinephrine 1 MG/ML Auto-Injector"
      }
    },
    {
      $group: {
        _id: "$_id",
        SUCCESSRATE: {
          $avg: "$SUCCESSRATES.SUCCESSRATE"
        }
      }
    },
    {
      $project: {
        _id: 0,
        NDA: "$SUCCESSRATES.NDA",
        medication_name: "$SUCCESSRATES.MEDICATION_NAME",
        successrate: "$SUCCESSRATE"
      }
    }
  ])

